import React from 'react';
import logo from '../images/appLogo.png'


export default function Header(props) {
    return (
        <>
            <header className="col-12 mainHead container">
                <div className="insideHeader">
                    <div className="col-6">
                        <img src={logo} alt="" />
                    </div>
                    <div className="col-6"></div>
                </div>
            </header>
        </>
    );
}
